                          openElevation: 0,
                          closedColor: Colors.transparent,
                          openColor: Colors.transparent,
                        )
                      ],
                    ),
                  ),
                  Container(
                      alignment: Alignment.centerLeft,
                      child: SvgPicture.asset(
                        'assets/images/logo.svg',
                        width: size.width * 0.5,
                      )),
                  Container(
                    padding: EdgeInsets.symmetric(horizontal: 20),
                    alignment: Alignment.centerLeft,
                    child: Text(
